import React,{useState} from "react";
import './WeatherInput.css';

export default function WeatherInput(){
    const [location,setLocation]=useState('');

    function handleInput(){
        console.log(location);
    }
    
    return(
        <div className="input-container">
            <div className="Weather-input">
                <input type='search' placeholder="Enter Location name...." value={location} name="location" 
                onChange={(e)=>{
                    setLocation(e.target.value);
                    }}/>
                <button type="submit" onClick={handleInput}><span className="material-symbols-outlined">search</span></button>
            </div>
        </div>
    )
}
